static PrimaryKey[] pathToKey(Collection<Path> paths) {
  if (paths == null) {
    return null;
  }

  final PrimaryKey[] keys = new PrimaryKey[paths.size()];
  int i = 0;
  for (Path p : paths) {
    keys[i++] = pathToKey(p);
  }
  return keys;
}
